import React from "react";

function UsersList(props) {
  return (
    <>
      {props.allUser &&
        props.allUser.map((user) => {
          return (
            <p key={user.id}>
              {user.userName} ({user.age} years old)
            </p>
          );
        })}
    </>
  );
}

export default UsersList;
